void resetInsertionMode() {
boolean last = false;
Iterator<Element> it = stack.descendingIterator();
while (it.hasNext()) {
Element node = it.next();
if (!it.hasNext()) {
last = true;
node = contextElement;
}
String name = node.nodeName();
if ("select".equals(name)) {
transition(TreeBuilderState.InSelect);
break; // frag
} else if (("td".equals(name) || "td".equals(name) && !last)) {
transition(TreeBuilderState.InCell);
break;
} else if ("tr".equals(name)) {
transition(TreeBuilderState.InRow);
break;
} else if ("tbody".equals(name) || "thead".equals(name) || "tfoot".equals(name)) {
transition(TreeBuilderState.InTableBody);
break;
} else if ("caption".equals(name)) {
transition(TreeBuilderState.InCaption);
break;
} else if ("colgroup".equals(name)) {
transition(TreeBuilderState.InColumnGroup);
break; // frag
} else if ("table".equals(name)) {
transition(TreeBuilderState.InTable);
break;
} else if ("head".equals(name)) {
transition(TreeBuilderState.InBody);
break; // frag
} else if ("body".equals(name)) {
transition(TreeBuilderState.InBody);
break;
} else if ("frameset".equals(name)) {
transition(TreeBuilderState.InFrameset);
break; // frag
} else if ("html".equals(name)) {
transition(TreeBuilderState.BeforeHead);
break; // frag
} else if (last) {
transition(TreeBuilderState.InBody);
break; // frag
}
}
}

void read(Tokeniser t, CharacterReader r) {
char c = r.consume();
switch (c) {
case '\t':
case '\n':
case '\f':
case ' ':
// ignore
break;
case '"':
t.transition(AttributeValue_doubleQuoted);
break;
case '&':
r.unconsume();
t.transition(AttributeValue_unquoted);
break;
case '\'':
t.transition(AttributeValue_singleQuoted);
break;
case nullChar:
t.error(this);
t.tagPending.appendAttributeValue(replacementChar);
t.transition(AttributeValue_unquoted);
break;
case eof:
t.eofError(this);
t.transition(Data);
break;
case '>':
t.error(this);
t.emitTagPending();
t.transition(Data);
break;
case '<':
case '=':
case '`':
t.error(this);
t.tagPending.appendAttributeValue(c);
t.transition(AttributeValue_unquoted);
break;
default:
r.unconsume();
t.transition(AttributeValue_unquoted);
}
}

